import React from 'react';

const UserCard = ({ user }) => {
  return (
    <div className="user-card">
      <div className="user-name">
        <h2>{user.name}</h2>
        <p>{user.posts}</p>
      </div>
      <a href={`/users/${user.id}`} className="user-link">
        <img src={user.avatar} alt={user.name} avatar />
      </a>
    </div>
  );
};

export default UserCard;
